import React from 'react';
import '../styles/Login.css';

function Login() {
  return (
    <div className="login-page">
      <div className="login-container">
        <div className="logo">
          <span className="logo-text-car">Car</span>
          <span className="logo-text-park">Park</span>
        </div>
        <div className="login-form">
          <input type="text" placeholder="Phone number" className="login-input-field" />
          <input type="password" placeholder="Password" className="login-input-field" />
          <a href="/forgot-password" className="forgot-password-link">Forgot Password?</a>
          <button className="login-button">Login</button>
          <div className="signup-text">
            or <a href="/signup">Signup</a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
